  [],\n\t\"revision_timestamp\": \"2016-08-04T08:15:56.831028\",\n\t\"name\": \"refuge-narrative-report-may-august-1956-kenai-national-moose-range\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Kenai NWR outlines
  Refuge accomplishments from May through August of 1956. The report begins by summarizing
  the weather conditions and water conditions during this period. Wildlife- including
  migratory birds, upland game birds, and big game animals- is also covered. The Refuge
  development and maintenance section discusses physical developments. Resource management
  is outlined; topics include timber removal. A progress report on field investigations
  and applied research is also provided. The public relations section of the report
  describes recreational uses.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
